import React from "react";
import "./Navbar.css";
import logo from "../../../assets/images/logo/logo-header@2x.png";
import medicamento1 from "../../../assets/images/image-slider/working-project-sl-1.png";
import medicamento2 from "../../../assets/images/image-slider/working-project-sl-2.png";
import medicamento3 from "../../../assets/images/image-slider/working-project-sl-3.png";
import SearchIcon from "@mui/icons-material/Search";
// import SidebarSearch from '../components/Search/SidebarSearch';


import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import Menu from '@mui/material/Menu';
import MenuIcon from '@mui/icons-material/Menu';
import Container from '@mui/material/Container';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import Tooltip from '@mui/material/Tooltip';
import MenuItem from '@mui/material/MenuItem';

import { Link } from "react-router-dom";
import SidebarSearch from "../../Search/SidebarSearch";

const pages = ['Formación', 'Actualidad', 'Conócenos', 'Acceder'];
// const links = [ <Link to="/formacion"></Link>, <Link to="/actualidad"></Link>, <Link to="/conocenos"></Link> , <Link to="/ingresar"></Link>];
const settings = ['Profile', 'Account', 'Dashboard', 'Logout'];

const Navbar = () => {
  const [anchorElNav, setAnchorElNav] = React.useState(null);
  const [anchorElUser, setAnchorElUser] = React.useState(null);

  const handleOpenNavMenu = (event) => {
    setAnchorElNav(event.currentTarget);
  };
  const handleOpenUserMenu = (event) => {
    setAnchorElUser(event.currentTarget);
  };

  const handleCloseNavMenu = () => {
    setAnchorElNav(null);
  };

  const handleCloseUserMenu = () => {
    setAnchorElUser(null);
  };

  return (
    <div id="navbar-container">
      <Container maxWidth="xl">
        <Toolbar disableGutters>
          <Typography
            variant="h6"
            noWrap
            component="div"
            sx={{ mr: 2, display: { xs: 'flex', md: 'flex' } }}
            style={{ margin: '20px'}}
          >
             <a href="index.html" rel="home" className="main-logo">
                <img src={logo} alt="images" id="logo" />
              </a>

              <Box sx={{ flexGrow: 0, display: { xs: 'flex', md: 'flex' } }} style={{marginTop: "5px"}}>
              <Button
                sx={{ my: 2, color: 'black', display: 'block' }}
              >Medicamentos</Button>
          </Box>
          <Box sx={{ flexGrow: 0, display: { xs: 'flex', md: 'flex' } }} style={{marginTop: "5px"}}>
              <Button
                sx={{ my: 2, color: 'black', display: 'block' }}
              >Higiene </Button>
          </Box>
          <Box sx={{ flexGrow: 0, display: { xs: 'flex', md: 'flex' } }} style={{marginTop: "5px"}}>
              <Button
                sx={{ my: 2, color: 'black', display: 'block' }}
              >Actualidad </Button>
          </Box>



          </Typography>
          <Box sx={{ flexGrow: 1, display: { xs: 'flex', md: 'flex' } }}  style={{marginTop: "5px"}}>
              <Button
                sx={{ my: 2, color: 'black', display: 'block' }}
              ><Link to='/conocenos' style={{ textDecoration: 'none', color:"black" }}>Conócenos</Link> </Button>
          </Box>
          <Box sx={{ flexGrow: 1, display: { xs: 'flex', md: 'flex' } }} style={{marginTop: "5px"}}>
              <Button
                sx={{ my: 2, color: 'black', display: 'block' }}
              ><Link to='/formacion' style={{ textDecoration: 'none', color:"black" }} >Formacion</Link> </Button>
          </Box>
          <Box sx={{ flexGrow: 1, display: { xs: 'flex', md: 'flex' } }}  style={{marginTop: "5px"}}>
              <Button
                sx={{ my: 2, color: 'black', display: 'block' }}
              ><Link to='/actualidad'style={{ textDecoration: 'none', color:"black" }}>Actualidad</Link> </Button>
          </Box>
          <Box sx={{ flexGrow: 1, display: { xs: 'flex', md: 'flex' } }}  style={{marginTop: "5px"}}>
              <Button
                sx={{ my: 2, color: 'black', display: 'block' }}
              ><Link to='/ingresar'style={{ textDecoration: 'none',  color:"black" }}>Acceder</Link> </Button>
          </Box>
          <div className="search-button"> <SidebarSearch /></div>

        </Toolbar>
      </Container>
    </div>
  );
};
export default  Navbar;
